  static async sendContactForm(data: ContactFormData): Promise<{success: boolean, message: string, data?: any}> {
    console.log('๐ค ุจุฏุก ุฅุฑุณุงู ุงูุจูุงูุงุช:', data);
    console.log('๐ ุงูุฑูุงุจุท ุงููุชุงุญุฉ:', this.WEBHOOK_ENDPOINTS);

    // ูุญุงููุฉ ุงูุฅุฑุณุงู ุฅูู ุงูุฎุฏูุงุช ุงููุฎุชููุฉ
    let lastError: any = null;

    for (let i = 0; i < this.WEBHOOK_ENDPOINTS.length; i++) {
      const endpoint = this.WEBHOOK_ENDPOINTS[i];
      console.log(`๐ ุงููุญุงููุฉ ${i + 1}/${this.WEBHOOK_ENDPOINTS.length}: ${endpoint}`);

      try {
        const requestData = {
          ...data,
          webhookAttempt: i + 1,
          attemptTime: new Date().toISOString()
        };

        console.log(`๐ค ุฅุฑุณุงู ุงูุจูุงูุงุช ุฅูู ${endpoint}:`, requestData);

        const response = await fetch(endpoint, {
          method: 'POST',
          mode: 'cors',
          headers: {
            'Content-Type': 'application/json',
            'Accept': 'application/json',
            'User-Agent': 'MasarFlow-ContactForm/1.0'
