        if (response.ok) {
          let responseData;
          try {
            responseData = await response.json();
          } catch (e) {
            responseData = { status: 'success', endpoint: endpoint };
          }

          console.log('โ ูุฌุญ ุงูุฅุฑุณุงู ุฅูู:', endpoint);
          console.log('๐ก ุงุณุชุฌุงุจุฉ ุงูุฎุงุฏู:', responseData);

          // ูุญุงูุงุฉ ุฅุฑุณุงู ุฅูููู
          this.simulateEmailSending(data);

          // ุญูุธ ุงูุจูุงูุงุช ูุญููุงู ููุณุฎุฉ ุงุญุชูุงุทูุฉ
          const savedData: SavedContactFormData = {
            ...data,
            status: 'sent',
            endpoint: endpoint
          };
          this.saveDataLocally(savedData);

          return {
            success: true,
            message: `ุชู ุฅุฑุณุงู ุฑุณุงูุชู ุจูุฌุงุญ ุนุจุฑ ${this.getEndpointName(endpoint)}!`,
            data: responseData
          };
        } else {
          lastError = `HTTP ${response.status}: ${response.statusText}`;
          console.warn(`โ๏ธ ูุดู ุงูุฅุฑุณุงู ุฅูู ${endpoint}: ${lastError}`);
        }
      } catch (error) {
        lastError = error;
        console.warn(`โ๏ธ ุฎุทุฃ ูู ุงูุฅุฑุณุงู ุฅูู ${endpoint}:`, error);
      }
    }

    // ุฅุฐุง ูุดูุช ุฌููุน ุงููุญุงููุงุชุ ุงุญูุธ ุงูุจูุงูุงุช ูุญููุงู
    console.warn('โ๏ธ ูุดูุช ุฌููุน ูุญุงููุงุช ุงูุฅุฑุณุงู');
    const failedData: SavedContactFormData = {
      ...data,
      status: 'failed',
      lastError: lastError?.toString()
    };
    this.saveDataLocally(failedData);

    // ุฅุฑุฌุงุน ูุดู ุงูุนูููุฉ
    return {
      success: false,
      message: 'ุญุฏุซ ุฎุทุฃ ูู ุงูุฅุฑุณุงู. ูุฑุฌู ุงููุญุงููุฉ ูุฑุฉ ุฃุฎุฑู.',
      data: { saved: true, localBackup: true, error: lastError }
    };
  }

  private static getEndpointName(endpoint: string): string {
    if (endpoint.includes('/api/contact')) return 'ูุธุงู Activepieces ุนุจุฑ Netlify';
    if (endpoint.includes('activepieces')) return 'ูุธุงู Activepieces';
    return 'ุงููุธุงู';
  }

  private static simulateEmailSending(data: ContactFormData) {
    // ูู ุงูุชุทุจูู ุงูุญููููุ ููุง ุณูุชู ุฅุฑุณุงู ุฅูููู ูุนูู
    console.log('๐ง ูุญุงูุงุฉ ุฅุฑุณุงู ุฅูููู ุฅูู:', data.email);
    console.log('๐ง ูุญุชูู ุงูุฅูููู:', {
      to: data.email,
      subject: 'ุชุฃููุฏ ุงุณุชูุงู ุฑุณุงูุชู - MasarFlow',
      body: `ูุฑุญุจุงู ${data.fullName}ุ ุดูุฑุงู ูุชูุงุตูู ูุนูุง. ุณูุฑุฏ ุนููู ูุฑูุจุงู.`
